  \"2016-07-28T15:32:54.135508\",\n\t\"name\": \"pesticide-product-label-system\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The Pesticide Product Label System (PPLS)
  provides a collection of pesticide product labels (Adobe PDF format) that have been
  approved by EPA under Section 3 of the Federal Insecticide, Fungicide, and Rodenticide
  Act (FIFRA). New labels were added to PPLS on November 21, 2014. Pesticide product
  labels provide critical information about how to safely handle and use registered
  pesticide products. An approved pesticide product label represents the full content
  of EPAs registration decision regarding that product. Pesticide labels contain detailed
  information on the use, storage, and handling of a product. This information will
  be found on EPA stamped-approved labels and, in some cases, in subsequent related
  correspondence, which is also included in PPLS. You may need to review several PDF
  files for a single product to determine the complete current terms of registration.\",\n\t\"license_title\":
